import React from "react";

const JoinRGM = () => {
  return (
    <div style={{ padding: "40px", textAlign: "center" }}>
      <h1>Join the RGM Family</h1>
      <p>Apply today to become part of the RGM family!</p>
      {/* You can add your Apply Now form here */}
    </div>
  );
};

export default JoinRGM;
